DROP FUNCTION IF EXISTS `Ufn_GenrateTransactionId`$$
CREATE DEFINER=`u328068492_bet`@`127.0.0.1` FUNCTION `Ufn_GenrateTransactionId` () RETURNS VARCHAR(25) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci  BEGIN

        DECLARE vId INT DEFAULT 1;
        DECLARE vCustomerCount INT DEFAULT 0;
        DECLARE vCustomerId VARCHAR(25) DEFAULT '';

        set time_zone = '+05:30';

        WHILE vId > 0 DO

                SELECT CONCAT("BatGame",SUBSTRING('123456789', RAND()*8+1, 1),
                              SUBSTRING('123456789', RAND()*8+1, 1),
                              SUBSTRING('123456789', RAND()*8+1, 1),
                              SUBSTRING('123456789', RAND()*8+1, 1),
                              SUBSTRING('123456789', RAND()*8+1, 1),
                              SUBSTRING('123456789', RAND()*8+1, 1)
                       ) INTO vCustomerId;

                SELECT COUNT(*) INTO vCustomerCount
                FROM wallet_transaction
                WHERE transaction_id= vCustomerId;

                IF vCustomerCount = 0 THEN
                        set vId = 0;
                END IF;

        END WHILE;

        RETURN vCustomerId;

END$$

DROP FUNCTION IF EXISTS `ufn_getsumvalue`$$
CREATE DEFINER=`u328068492_bet`@`127.0.0.1` FUNCTION `ufn_getsumvalue` (`value` INT) RETURNS INT(11)  BEGIN

  DECLARE index1 INT DEFAULT CHAR_LENGTH(value);
  DECLARE vCustomerCount INT DEFAULT 1;
  DECLARE totalcount INT DEFAULT 0;

  set time_zone = '+05:30';
  

  WHILE vCustomerCount <= index1 DO
            
    set totalcount= totalcount+SUBSTRING(value,vCustomerCount,1);
    set vCustomerCount=vCustomerCount+1;

  END WHILE;
  
  
  IF CHAR_LENGTH(totalcount)>1
  THEN 
  set totalcount= SUBSTRING(totalcount,2,1);
  END IF ;
  RETURN totalcount;

END$$

