DROP TRIGGER IF EXISTS `before_wallet_insert`;
DELIMITER $$
CREATE TRIGGER `before_wallet_insert` BEFORE INSERT ON `member_wallet` FOR EACH ROW BEGIN
    -- Cast the member_wallet_balance to a DECIMAL for comparison
    IF CAST(NEW.member_wallet_balance AS DECIMAL) < 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Wallet balance cannot be negative';
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `before_wallet_update`;
DELIMITER $$
CREATE TRIGGER `before_wallet_update` BEFORE UPDATE ON `member_wallet` FOR EACH ROW BEGIN
    -- Cast the member_wallet_balance to a DECIMAL for comparison
    IF CAST(NEW.member_wallet_balance AS DECIMAL) < 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Wallet balance cannot be negative';
    END IF;
END
$$
DELIMITER ;

